import React from 'react';


const Todo = () =>{
    return(
        <div>
            <h3>Todo App</h3>
            <div style={{border:"solid black"}}>
                <div >
                <input type="checkbox" id="vehicle1" name="vehicle1" value="Bike"/>
                <label for="vehicle1"> I have a bike</label>
                </div>
                <div><button>Completed</button></div>
            </div>
        </div>
    )
}

export default Todo;
